import React from "react";
import Navbar from "./Navbar";

function Webinars() {
  return (
   <div className="p-8">
    <Navbar/>
      <h1 className="text-4xl font-bold mb-4">Webinars</h1>
      <p className="text-lg">Welcome to the Webinars Page!</p>
    </div>
  );
}


export default Webinars;
